import { createRouter, createWebHistory } from "@ionic/vue-router"
import MainLayout from "@/layouts/MainLayout.vue"
import LoginView from "@/views/LoginView.vue"
import ContenidoView from "@/views/ContenidoView.vue"
import PerfilView from "@/views/PerfilView.vue"
import ChatsView from "@/views/ChatsView.vue"

const routes = [
  {
    path: "/login",
    component: LoginView
  },
  {
    path: "/app",
    component: MainLayout,
    children: [
      { path: "contenido", component:() => import("@/views/ContenidoView.vue") },
      { path: "perfil", component:() => import("@/views/PerfilView.vue") },
      { path: "chats", component:() => import("@/views/ChatsView.vue") } // Carga perezosa
    ]
  },
  {
    path: "/",
    redirect: "/app/contenido"
  }
]

export default createRouter({
  history: createWebHistory(), // ðŸ”¹ corregido
  routes
})
